INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1, 1110501, 1, 1110501043, "", "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 0, 0, 11, 4, 111011);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", 1110501, "", 1110501044, "", "", "", "", 91, "", 0);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", 1110501, 0, 1110501045, "", "vo_adv_1110501_002", "", "", 21, 0, "vo_adv_1110501");
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1, 1110501, 1, 1110501046, "", "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 0, 0, 11, 4, 111011);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", 1110501, "", 1110501047, "", "", "", "", 91, "", 0);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", 1110501, 0, 1110501048, "", "vo_adv_1110501_003", "", "", 21, 0, "vo_adv_1110501");
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1, 1110501, 1, 1110501049, "", "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 0, 0, 11, 5, 111011);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES ("", 1110501, "", 1110501050, "", "", "", "", 91, "", 0);
